We have 3 types of fats: Saturated, Monosaturated, Polyunsaturated.

When we talk about healthy fats, we usually refer to Mono and Polyunsaturated ones, however, humans have always consumed unprocessed saturated fats since thousands of years ago, so we better call unhealthy fats, those unprocessed ones coming from whole foods

As for the real unhealthy ones, we clearly know that trans-fatty acids, hydrogenated fats and shelf-stable cooking oils (safflower, soybean, corn oil) belong to this category.

Why are healthy fats important?

-They support metabolism, cell signalling, hormone production, and the absorption of certain vitamins (like D)

-They play an important role in keeping hunger levels low.

-They can protect against cardiovascular diseases.

-Lastly, they are a secondary source of energy for our bodies.

